      ><a href=\"#Favorite_UT_Weapons\"><span class=\"tocnumber\">6</span> <span class=\"\
      toctext\">Favorite UT Weapons</span></a></li>\n</ul>\n</div>\n\n<h2><span class=\"\
      mw-headline\" id=\"Bioflakcake22\">Bioflakcake22</span><span class=\"mw-editsection\"\
      ><span class=\"mw-editsection-bracket\">[</span><a href=\"/edit/User:Bioflakcake22?section=1\"\
      \ title=\"Edit section: Bioflakcake22\">edit</a><span class=\"mw-editsection-bracket\"\
      >]</span></span></h2>\n<p>Bioflakcake is a contributor to Liandri Archives,\
      \ hoping to correct the many stubs in the <a href=\"/Deathmatch\" title=\"Deathmatch\"\
      >Deathmatch</a>, <a href=\"/Capture_The_Flag\" class=\"mw-redirect\" title=\"\
      Capture The Flag\">Capture The Flag</a>, and <a href=\"/Onslaught\" title=\"\
      Onslaught\">Onslaught</a> <a href=\"/UT2004_Maps\" class=\"mw-redirect\" title=\"\
      UT2004 Maps\">UT2004 Maps</a> pages.\n</p>\n<h2><span class=\"mw-headline\"\
      \ id=\"Personality\">Personality</span><span class=\"mw-editsection\"><span\
      \ class=\"mw-editsection-bracket\">[</span><a href=\"/edit/User:Bioflakcake22?section=2\"\
      \ title=\"Edit section: Personality\">edit</a><span class=\"mw-editsection-bracket\"\
      >]</span></span></h2>\n<p>Bio is more of a recluse, but may join in discussions\
      \ if interested. He is chipping in to fix the dismal state of the Map categories.\n\
      </p>\n<h2><span class=\"mw-headline\" id=\"Favorite_Books\">Favorite Books</span><span\
      \ class=\"mw-editsection\"><span class=\"mw-editsection-bracket\">[</span><a\
      \ href=\"/edit/User:Bioflakcake22?section=3\" title=\"Edit section: Favorite\
      \ Books\">edit</a><span class=\"mw-editsection-bracket\">]</span></span></h2>\n\
      <p>Bioflakcake22 rather enjoys the Hunger Games series, Lord of the Rings, and\
      \ H.G.Wells stories.\n</p>\n<h2><span class=\"mw-headline\" id=\"Favorite_Television_Programs\"\
      >Favorite Television Programs</span><span class=\"mw-editsection\"><span class=\"\
      mw-editsection-bracket\">[</span><a href=\"/edit/User:Bioflakcake22?section=4\"\
      \ title=\"Edit section: Favorite Television Programs\">edit</a><span class=\"\
      mw-editsection-bracket\">]</span></span></h2>\n<p>Bio likes anything sci-fi,\
      \ as long as it's not boring or stupid. Particularly, he enjoys Doctor Who,\
      \ Star Trek, Babylon 5, and the Twilight Zone.\n</p>\n<h2><span class=\"mw-headline\"\
      \ id=\"Favorite_UT_Gametypes\">Favorite UT Gametypes</span><span class=\"mw-editsection\"\
      ><span class=\"mw-editsection-bracket\">[</span><a href=\"/edit/User:Bioflakcake22?section=5\"\
      \ title=\"Edit section: Favorite UT Gametypes\">edit</a><span class=\"mw-editsection-bracket\"\
      >]</span></span></h2>\n<p>Bio's favorite gametype is <a href=\"/Onslaught\"\
      \ title=\"Onslaught\">Onslaught</a>, while his least favorite is <a href=\"\
      /Invasion\" title=\"Invasion\">Invasion</a>.\n</p>\n<h2><span class=\"mw-headline\"\
      \ id=\"Favorite_UT_Weapons\">Favorite UT Weapons</span><span class=\"mw-editsection\"\
      ><span class=\"mw-editsection-bracket\">[</span><a href=\"/edit/User:Bioflakcake22?section=6\"\
      \ title=\"Edit section: Favorite UT Weapons\">edit</a><span class=\"mw-editsection-bracket\"\
      >]</span></span></h2>\n<p>Bio's favorite weapon is either the <a href=\"/Shock_Rifle\"\
      \ title=\"Shock Rifle\">Shock Rifle</a> or the <a href=\"/Flak_Cannon\" title=\"\
      Flak Cannon\">Flak Cannon</a>. His least favorite is the <a href=\"/Shield_Gun\"\
      \ title=\"Shield Gun\">Shield Gun</a>.\n</p>\n<hr />\n<p>Thank you for getting\
      \ to know me. It's much appreciated.\n</p>\n<!-- \nNewPP limit report\nCached\
