  wikitext:
    text: "==Bioflakcake22==\nBioflakcake is a contributor to Liandri Archives, hoping\
      \ to correct the many stubs in the [[Deathmatch]], [[Capture The Flag]], and\
      \ [[Onslaught]] [[UT2004 Maps]] pages.\n\n==Personality==\nBio is more of a\
      \ recluse, but may join in discussions if interested. He is chipping in to fix\
      \ the dismal state of the Map categories.\n\n==Favorite Books==\nBioflakcake22\
      \ rather enjoys the Hunger Games series, Lord of the Rings, and H.G.Wells stories.\n\
      \n==Favorite Television Programs==\nBio likes anything sci-fi, as long as it's\
      \ not boring or stupid. Particularly, he enjoys Doctor Who, Star Trek, Babylon\
      \ 5, and the Twilight Zone.\n\n==Favorite UT Gametypes==\nBio's favorite gametype\
      \ is [[Onslaught]], while his least favorite is [[Invasion]].\n\n==Favorite\
      \ UT Weapons==\nBio's favorite weapon is either the [[Shock Rifle]] or the [[Flak\
      \ Cannon]]. His least favorite is the [[Shield Gun]].\n\n----\nThank you for\
      \ getting to know me. It's much appreciated."
